import React from 'react';

function ResultsPage({ location }) {
  return (
    <div className="container mt-5">
      <h1>查询结果</h1>
      <div className="alert alert-info">
        {location.state ? location.state.result : "没有提供查询结果"}
      </div>
    </div>
  );
}

export default ResultsPage;
